import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import BlurText from './BlurText';
import { motion } from 'framer-motion';
import './Hero.css';

const Hero = () => {
  const [mousePosition, setMousePosition] = useState({ x: 0, y: 0 });
  const [isHovering, setIsHovering] = useState(false);

  useEffect(() => {
    const handleMouseMove = (e) => {
      setMousePosition({
        x: (e.clientX / window.innerWidth - 0.5) * 2,
        y: (e.clientY / window.innerHeight - 0.5) * 2
      });
    };

    window.addEventListener('mousemove', handleMouseMove);
    return () => window.removeEventListener('mousemove', handleMouseMove);
  }, []);

  return (
    <section className="hero">
      <motion.div 
        className="hero-content"
        animate={{
          x: mousePosition.x * 20,
          y: mousePosition.y * 20,
          rotateX: mousePosition.y * 5,
          rotateY: mousePosition.x * 5
        }}
        transition={{ type: "spring", stiffness: 100, damping: 20 }}
      >
        <BlurText
          text="Track. Improve. Dominate."
          delay={150}
          animateBy="words"
          direction="top"
          className="hero-title"
        />

        <BlurText
          text="Codevo is Your All in One Coding Platform"
          delay={100}
          animateBy="words"
          direction="top"
          className="hero-subtitle"
        />

        <motion.div 
          className="hero-buttons"
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ delay: 0.5 }}
        >
          <motion.div
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
          >
            <Link to="/login" className="btn-wrapper">
              Login
            </Link>
          </motion.div>
          <motion.div
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
          >
            <Link 
              to="/signup" 
              className="btn-wrapper btn-blue"
              onMouseEnter={() => setIsHovering(true)}
              onMouseLeave={() => setIsHovering(false)}
            >
              <motion.span
                animate={{
                  scale: isHovering ? [1, 1.2, 1] : 1,
                  rotate: isHovering ? [0, 5, -5, 0] : 0
                }}
                transition={{ duration: 0.5 }}
              >
                Get Started
              </motion.span>
            </Link>
          </motion.div>
        </motion.div>

        <motion.div 
          className="hero-features"
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ delay: 0.8 }}
        >
          <motion.div 
            className="feature"
            whileHover={{ scale: 1.1, rotate: 5 }}
            transition={{ type: "spring", stiffness: 300 }}
          >
            <span className="feature-icon">ðŸš€</span>
            <span className="feature-text">Fast Learning</span>
          </motion.div>
          <motion.div 
            className="feature"
            whileHover={{ scale: 1.1, rotate: -5 }}
            transition={{ type: "spring", stiffness: 300 }}
          >
            <span className="feature-icon">ðŸ’¡</span>
            <span className="feature-text">Smart Practice</span>
          </motion.div>
          <motion.div 
            className="feature"
            whileHover={{ scale: 1.1, rotate: 5 }}
            transition={{ type: "spring", stiffness: 300 }}
          >
            <span className="feature-icon">ðŸŽ¯</span>
            <span className="feature-text">Track Progress</span>
          </motion.div>
        </motion.div>
      </motion.div>
    </section>
  );
};

export default Hero;
